import React from 'react';
import { Link } from 'react-router-dom';
import style from "./NavBar.module.css"
import { useNavigate } from 'react-router-dom';



const NavBar = () =>{
    
    const navigate = useNavigate();

    const handleShowUsers = () =>{
        navigate('/users');
      }
    
      const handleShowDoctors = () =>{
        navigate('/doctors');
      }
    
    return (
        <nav className={style.navbar}>
            <div className={style.container}>
                <Link to = "/about" className={style.about}>About</Link>
                
                <div className={style.users}>                
                    <button onClick={handleShowUsers}>Pacientes</button>
                </div>
                
                <div className={style.doctors}>                
                    <button onClick={handleShowDoctors}>Doctores</button>
                </div>
                
                <Link to = "/form" className={style.btn}>
                <button className='login'>LOG IN</button>  
                </Link>
           

            </div>
        </nav>
    )
}
export default NavBar;
